import {Bar, Doughnut, Line} from 'react-chartjs-2';    
import array from './array';

const MyChart = () => {
    ages = array.map((item) => item.Age);
    salaries = array.map((item) => item.Salary);


    return (

        <div>
            <Bar 
            data = {{
                labels: ['A', 'B', 'C'],
                datasets : [
                    {
                        label: "Revenue",
                        data: [200,300,400],
                    },
                ],
            }}
            />
        </div>


    );
}

export default MyChart;
